import React from "react";
import './App.css';
import img from './images/background.png'

const App = () => {
  return (
    <div className="Header">
      <a href="#" className="Logo">Logo</a>
      <span className="navigatorBtn">
        <a href="#" className="HomeBtn">Home</a>
        <a href="#" className="InvestmentBtn">Investment</a>
        <a href="#" className="About_UsBtn">About Us</a>
        <a href="#" className="Contact_USBtn">Contact US</a>
      </span>
      <span className="AccountBox">
        <a href="#" className="accountBtn">Account</a>
        <a href="#" className="profileBtn">
          <img src={img} className="ProfileImg"></img>
        </a>
      </span>
    </div>
  );
};

export default App;
